import React, { useEffect, useState } from 'react';
import './MatchingResultPage.css';

const MatchingResultPage = () => {
  const [userData, setUserData] = useState({});

  useEffect(() => {
    const fetchDataFromBackend = async () => {
      try {
        const response = await fetch('/api/userData'); // 백엔드 엔드포인트 URL로 대체
        if (!response.ok) {
          throw new Error('데이터를 불러올 수 없습니다.');
        }
        const data = await response.json();
        setUserData(data);
      } catch (error) {
        console.error('데이터 가져오기 오류:', error);
      }
    };

    fetchDataFromBackend();
  }, []);

  return (
    <div className="matchingresultpage">
      <div className="intj1">{userData.sport}</div>
      <div className="intj2">{userData.days}</div>
      <div className="intj3">{userData.mbti}</div>
    </div>
  );
};

export default MatchingResultPage;
